const https = require('https');


const regexGobierno   =  /^\/espanol(\/|$)/;
const regexUsaFeature =  /^\/features(\/|$)/;
const regexGobFeature =  /^\/espanol\/novedades(\/|$)/;

const usa404Path = '/page-error/index.html';
const gob404Path = '/espanol/pagina-error/index.html';
const api404Path = '/search-error/index.html';

const pathUsaFeature = '/features';
const pathGobFeature = '/espanol/novedades';

const spanishPrefix  = '/espanol/';

/// aws lambda entry point
exports.handler = async (event, context, callback) => 
{
    var response = event.Records[0].cf.response;
    var request  = event.Records[0].cf.request;

    var domain = 'https://'+event.Records[0].cf.config.distributionDomainName;

    /// add sts header
    response.headers['strict-transport-security'] = [{
        key: 'Strict-Transport-Security',   
        value: 'max-age=31536000'
    }];

    /// api 404
    if ( isApi404(response.status,request.uri) ) 
    {
        response.status = 404;
        response.statusDescription = 'Search Error';
        callback(null, response);
        return;
    }

    /// process 404 
    if (response.status >= 400 && response.status <= 599 ) 
    {
        var loader = null;
        var response404Uri = rewriteResponse404(request.uri);

        /// handle possible redirects
        if ( response404Uri.redirect )
        {
            response.status = 302;
            response.headers['location'] = [{
                key:   'Location', 
                value: response404Uri.path
            }];
            callback(null, response);
            return;
        } else {
            loader = loadPageBody(event,domain+response404Uri.path);
        }

        /// loader sanity check
        if ( !loader ) {
            callback(null, response);
            return;
        }

        /// prep response with body-replacement headers
        response.headers['cache-control'] = [{
            key:   'Cache-Control', 
            value: 'max-age=1'
        }];
        response.headers['content-type'] = [{
            key:   'Content-Type', 
            value: 'text/html'
        }];
        response.headers['content-encoding'] = [{
            key:   'Content-Encoding', 
            value: 'UTF-8'
        }];

        /// replace body with alternate 404 page body
        await loader.then((body)=>{
            response.body = body;

        /// replace body with default hardcoded body
        }).catch((err)=>{
            console.error(err);
            response.body = default404HTML;
        });
    }

    callback(null, response);
};

const isApi404 = (status,url) =>
{
    return ( (status == 200) && url.startsWith(api404Path) );
}

const rewriteResponse404 = ( url ) =>
{
	if ( regexUsaFeature.test(url) ) {
		return {path:pathUsaFeature,redirect:true};
	}
	if ( regexGobFeature.test(url) ) {
		return {path:pathGobFeature,redirect:true};
	}
	if ( regexGobierno.test(url) ) {
		return {path:gob404Path,redirect:false};
	}
  return {path:usa404Path,redirect:false};
}


const loadPageBody = (event,uri) => 
{
    return new Promise( (resolve,reject) =>
    {
        process.env["NODE_TLS_REJECT_UNAUTHORIZED"] = 0;
        const req = https.get(uri, (res) => 
		{
			if (res.statusCode < 200 || res.statusCode >= 300) 
			{                
                reject('rejected: status='+res.statusCode);
                return;
			}
			var body = [];
            res.on('data', chunk => {
                body.push(chunk);
			}).on('end', () => {
                try {
                    body = Buffer.concat(body).toString();
                    resolve(body);
                } catch(e) {
                    reject('rejected: body concat',e);
                }
            });
        }).on('error', (e) => {
            reject('rejected: 404request error',e);
        });
        /// set a tight turnaround on loading 404 page. 
        req.setTimeout( 1000, () => {
            req.abort();
            reject('rejected: internal load timeout');
        });
    });
};

